import React from 'react'
import {Col, Container, Row} from "react-bootstrap";

const BottomContent = () => {
    return (<Container fluid>
        <Row>
            <Col lg={4}>1 of 1</Col>
            <Col lg={8}>1 of 1</Col>
        </Row>
    </Container>)
};

export default  BottomContent;
